using RestSharp;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Net.Http;
using System.Text;
using System.Threading.Tasks;

namespace OneShotApp
{
    class Program
    {
        private static readonly string FileData = "";

        static void Main(string[] args)
        {
            Console.WriteLine("Ingrese el usuario al que desea crearle los archivos:");
            string user = Console.ReadLine();
            Console.WriteLine("Ingrese la cantidad de archivos que desea crear:");
            int files = int.Parse(Console.ReadLine());

            Init(user);

            for (int i = 0; i < files; i++)
            {
                var fileId = CreateFile(i + 1);
                CreateSignRequest(fileId, user);
            }
        }

        public static void Init(string user)
        {
            var client = new RestClient("http://localhost");
            // client.Authenticator = new HttpBasicAuthenticator(username, password);
            var request = new RestRequest("/api/BelApp/InitSession");
            request.AddParameter("License", "f32m6AK9@Ca6?Wn");
            request.AddParameter("Installation", user);
            request.AddParameter("PlatformIdentifier", "BEL_APP");

            var response = client.Post(request);
            var content = response.Content; // Raw content as string
            Console.WriteLine(content);
        }

        public static int CreateFile(int number)
        {
            var client = new RestClient("http://localhost");
            // client.Authenticator = new HttpBasicAuthenticator(username, password);
            var request = new RestRequest("/api/BelApp/CreateFile");
            request.AddParameter("Name", "SOLICITUD DE CR_DITO - DEUDOR " + number.ToString());
            request.AddParameter("CaseNo", "12345");
            request.AddParameter("ExpirationDate", "2022-12-31");
            request.AddParameter("Data", FileData);
            request.AddHeader("Authorization", "Bearer qe93KC5glEeCb_p9UvJjB27sfIU6pFoY");
            var response2 = client.Post<File>(request);
            Console.WriteLine(response2.Id);
            return response2.Id;
        }

        public static void CreateSignRequest(int file, string user)
        {
            var client = new RestClient("http://localhost");
            // client.Authenticator = new HttpBasicAuthenticator(username, password);
            var request = new RestRequest("/api/BelApp/CreateSignRequest");
            request.AddParameter("FileId", file.ToString());
            request.AddParameter("Installation", user);
            request.AddParameter("CreatedDate", "2022-12-20");
            request.AddParameter("ExpireDate", "2022-12-31");
            request.AddParameter("CaseNo", "12345");
            request.AddParameter("Close", true);
            request.AddParameter("PlatformIdentifier", "BEL_APP");
            request.AddParameter("X", 100);
            request.AddParameter("Y", 100);
            request.AddParameter("Height", 100);
            request.AddParameter("Width", 150);
            request.AddParameter("Page", 1);
            request.AddHeader("Authorization", "Bearer qe93KC5glEeCb_p9UvJjB27sfIU6pFoY");
            var response = client.Post(request);
            var content = response.Content; // Raw content as string
            Console.WriteLine(content);
        }
    }

    public class File
    {
        public int Id { get; set; }
    }
}
